import React from "react";
import { NavItem } from "reactstrap";

import SigninButton from "../signin-button/SigninButton.js";
import SignupButton from "../signup-button/SignupButton.js";

class NavbarButtons extends React.Component {
  render() {
    return (
      <div className="d-lg-flex d-inline-block mr-lg-auto align-items-center">
        <NavItem className="d-inline m-0">
          <SigninButton />
        </NavItem>

        <NavItem className=" d-inline p-1 m-0 ">
          <SignupButton />
        </NavItem>
      </div>
    );
  }
}

export default NavbarButtons;
